import React, { useEffect, useState } from "react";
import './App.css'

function ArticleLists(props){
    const [articleList, setArticleList] = useState({
        data : 
            {
                id: 'DEFAULT',
                title: 'DEFAULT',
                created_id: 'DEFAULT',
                created_at: 'DEFAULT',
                category_name: 'DEFAULT',
                visit_cnt: 'DEFAULT',
                comment_cnt: 'DEFAULT'
            }
    });

    
    useEffect(()=> {
        setArticleList(props.ArticleLists);
        console.log(articleList);
        console.log(articleList.data[0]);
    },[props.ArticleLists, articleList])

    const test = articleList.data[8];


    return (
        <div>
            Board Data(Text → JSON) :
            <ul id="ulNone">
                <li><b>ID : </b> <span key={articleList.data[8]}>{articleList.data.id}</span> <br/></li>
                <li><b>Title : </b> <span key={articleList.data[8]}>{test.title}</span> <br/></li>
                <li><b>Category : </b> <span key={articleList.data[8]}>{test.category_name}</span> <br/></li>
                <li><b>Created By : </b> <span key={articleList.data[8]}>{test.created_id}</span> <br/></li>
                <li><b>Created At : </b> <span key={articleList.data[8]}>{test.created_at}</span> <br/></li>
                <li><b>Visit : </b> <span key={articleList.data[8]}>{test.visit_cnt}</span> <br/></li>
                <li><b>Comment : </b> <span key={articleList.data[8]}>{test.comment_cnt}</span> <br/></li>
            </ul>
            {/* <Article list={articleList.data}/> */}
        </div>
    )
}

function Article({data, key}) {
    return (
      <ul id="ulNone" key={data}>
        {/* article만 불러오면 출력이 안됨, .data 또는 .id 등 붙이면 못읽음
            articleList에 값이 아직 없는 상태에서 출력하려고 하는 것 같음 */}
        {/* <li><b>ID : </b> <span key={data[0].id}>{data[0].id}</span> <br/></li> */}
        <li><b>ID : </b> <span key={data}>{data}</span> <br/></li>
        <li><b>Title : </b> <span>{data}</span> <br/></li>
        <li><b>Category : </b> <span>{data}</span> <br/></li>
        <li><b>Created By : </b> <span>{data}</span> <br/></li>
        <li><b>Created At : </b> <span>{data}</span> <br/></li>
        <li><b>Visit : </b> <span>{data}</span> <br/></li>
        <li><b>Comment : </b> <span>{data}</span> <br/></li>
      </ul>
    );
}

export default ArticleLists;
